import React from 'react';

function About() {
    return (
        <section className="main main__about">
            <main className="about__container">
                <article className="profile__picture">
                    <img src="/public/images/me.svg" alt="Picture of me" />
                </article>
            </main>
        </section>
    );
}

export default About;
